import Header from '../Components/Header';
import Footer from '../Components/Footer';

class Home extends Component {
    render() {
        return (
            <>
            <Header />
                <div className='contentContainer'>
                    <h1>main header</h1>
                    <p>paragraph</p>
                </div>
                <Footer />
            </>
        );
    }
}

export default Home;
